// Debug: Show all data received
const output = {
  hasJson: !!$input.item.json,
  hasBinary: !!$input.item.binary,
  jsonKeys: Object.keys($input.item.json || {}),
  binaryKeys: Object.keys($input.item.binary || {}),
  json: $input.item.json,
  binaryInfo: {}
};

if ($input.item.binary) {
  Object.keys($input.item.binary).forEach(key => {
    const bin = $input.item.binary[key];
    output.binaryInfo[key] = {
      mimeType: bin.mimeType,
      fileExtension: bin.fileExtension,
      fileName: bin.fileName,
      dataSize: bin.data ? bin.data.length : 0
    };
  });
}

return output;
